import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to appear (using .product-price class)
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Take screenshot of the product grid area if present
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_2_products_grid.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_products_grid.png'));
    }

    // Extract all product prices (visible on the page)
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => node.textContent.trim())
    );

    // Clean up prices: extract only the price number (e.g., "$1199.99")
    const extractedPrices = prices.map(text => {
      // Match $ and numbers, possibly with decimals
      const match = text.match(/\$\d[\d,]*(\.\d{2})?/);
      return match ? match[0] : text;
    });

    // Take a screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_extraction.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_extraction.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: { prices: extractedPrices },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
